import React, { Component } from "react";
import { Card, CardBody, Jumbotron, Container, Row, Col } from "reactstrap";

export class ImagenDetalle extends Component {
  render() {
    const { tarjetas, link_id } = this.props;

    return (
      <div>
        {tarjetas &&
          tarjetas
            .filter(({ _id }) => _id === link_id)
            .map(({ color, numero }) => {
              return (
                <div>
                  <Row>
                    <Col>
                      <Jumbotron>
                        <Container width={100}>
                          <img
                            src={`${process.env.PUBLIC_URL}/uploads/${
                              color + numero
                            }.png`}
                            responsive
                          />
                        </Container>
                      </Jumbotron>
                    </Col>
                  </Row>
                </div>
              );
            })}
      </div>
    );
  }
}

export default ImagenDetalle;
